  "views/partials/textarea": "<div  tabindex=\"-1\" id=\"js-form-group-{{ id }}\" class=\"col-sm-12 form-group {{# isRequired }} required {{/ isRequired }} {{# isErrorVisible }}error {{/ isErrorVisible}}\" {{^isVisible}}style=\"display:none;\"{{/isVisible}} >\r\n\r\n\t<label class=\"label-text\" for=\"{{ id }}\" id=\"label__textarea-{{id}}\">{{ labelText }}</label>\r\n\t{{^isRequired}}<span class=\"is-required-text\">(Optional)</span>{{/isRequired}}\r\n\r\n\t<span class=\"error-message mb-1\" {{^isErrorVisible}}style=\"display:none;\"{{/isErrorVisible}}>{{validationMessage}}</span>\r\n\r\n\t{{#hintText}}\r\n\t\t<div class=\"form-hint mb-1\">{{hintText}}</div>\r\n\t{{/hintText}}\r\n\r\n\t<textarea rows=\"6\" class=\"form-control\" name=\"{{# name}}{{ name }}{{/name}}{{^name}}{{ id }}{{/name}}\" id=\"{{ id }}\">{{ answerValue }}</textarea>\r\n</div>\r\n",
