  "node_modules/pend/test.js": "var assert = require('assert');\nvar Pend = require('./');\n\nvar tests = [\n  {\n    name: \"basic\",\n    fn: testBasic,\n  },\n  {\n    name: \"max\",\n    fn: testWithMax,\n  },\n  {\n    name: \"callback twice\",\n    fn: testCallbackTwice,\n  },\n  {\n    name: \"calling wait twice\",\n    fn: testCallingWaitTwice,\n  },\n  {\n    name: \"hold()\",\n    fn: testHoldFn,\n  },\n];\nvar testCount = tests.length;\n\ndoOneTest();\n\nfunction doOneTest() {\n  var test = tests.shift();\n  if (!test) {\n    console.log(testCount + \" tests passed.\");\n    return;\n  }\n  process.stdout.write(test.name + \"...\");\n  test.fn(function() {\n    process.stdout.write(\"OK\\n\");\n    doOneTest();\n  });\n}\n\nfunction testBasic(cb) {\n  var pend = new Pend();\n  var results = [];\n  pend.go(function(cb) {\n    results.push(1);\n    setTimeout(function() {\n      results.push(3);\n      cb();\n    }, 500);\n  });\n  pend.go(function(cb) {\n    results.push(2);\n    setTimeout(function() {\n      results.push(4);\n      cb();\n    }, 1000);\n  });\n  pend.wait(function(err) {\n    assert.deepEqual(results, [1,2,3,4]);\n    cb();\n  });\n  assert.deepEqual(results, [1, 2]);\n}\n\nfunction testWithMax(cb) {\n  var pend = new Pend();\n  var results = [];\n  pend.max = 2;\n  pend.go(function(cb) {\n    results.push('a');\n    setTimeout(function() {\n      results.push(1);\n      cb();\n    }, 500);\n  });\n  pend.go(function(cb) {\n    results.push('b');\n    setTimeout(function() {\n      results.push(1);\n      cb();\n    }, 500);\n  });\n  pend.go(function(cb) {\n    results.push('c');\n    setTimeout(function() {\n      results.push(2);\n      cb();\n    }, 100);\n  });\n  pend.wait(function(err) {\n    assert.deepEqual(results, ['a', 'b', 1, 'c', 1, 2]);\n    cb();\n  });\n  assert.deepEqual(results, ['a', 'b']);\n}\n\nfunction testCallbackTwice(cb) {\n  var pend = new Pend();\n  pend.go(function(cb) {\n    setTimeout(cb, 100);\n  });\n  pend.go(function(cb) {\n    cb();\n    assert.throws(cb, /callback called twice/);\n  });\n  pend.wait(cb);\n}\n\nfunction testCallingWaitTwice(cb) {\n  var pend = new Pend();\n  pend.go(function(cb) {\n    setTimeout(cb, 100);\n  });\n  pend.wait(function() {\n    pend.go(function(cb) {\n      setTimeout(cb, 50);\n    });\n    pend.go(function(cb) {\n      setTimeout(cb, 10);\n    });\n    pend.go(function(cb) {\n      setTimeout(cb, 20);\n    });\n    pend.wait(cb);\n  });\n}\n\nfunction testHoldFn(cb) {\n  var pend = new Pend();\n  setTimeout(pend.hold(), 100);\n  pend.go(function(cb) {\n    cb();\n  });\n  pend.wait(cb);\n}\n",
