  "node_modules/mkdirp/test/perm.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\n\ntest('async perm', function (t) {\n    t.plan(5);\n    var file = '/tmp/' + (Math.random() * (1<<30)).toString(16);\n    \n    mkdirp(file, 0755, function (err) {\n        t.ifError(err);\n        exists(file, function (ex) {\n            t.ok(ex, 'file created');\n            fs.stat(file, function (err, stat) {\n                t.ifError(err);\n                t.equal(stat.mode & 0777, 0755);\n                t.ok(stat.isDirectory(), 'target not a directory');\n            })\n        })\n    });\n});\n\ntest('async root perm', function (t) {\n    mkdirp('/tmp', 0755, function (err) {\n        if (err) t.fail(err);\n        t.end();\n    });\n    t.end();\n});\n",
  "node_modules/mkdirp/test/race.js": "var mkdirp = require('../').mkdirp;\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\n\ntest('race', function (t) {\n    t.plan(6);\n    var ps = [ '', 'tmp' ];\n    \n    for (var i = 0; i < 25; i++) {\n        var dir = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n        ps.push(dir);\n    }\n    var file = ps.join('/');\n    \n    var res = 2;\n    mk(file, function () {\n        if (--res === 0) t.end();\n    });\n    \n    mk(file, function () {\n        if (--res === 0) t.end();\n    });\n    \n    function mk (file, cb) {\n        mkdirp(file, 0755, function (err) {\n            t.ifError(err);\n            exists(file, function (ex) {\n                t.ok(ex, 'file created');\n                fs.stat(file, function (err, stat) {\n                    t.ifError(err);\n                    t.equal(stat.mode & 0777, 0755);\n                    t.ok(stat.isDirectory(), 'target not a directory');\n                    if (cb) cb();\n                });\n            })\n        });\n    }\n});\n",
  "node_modules/mkdirp/test/root.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar test = require('tap').test;\n\ntest('root', function (t) {\n    // '/' on unix, 'c:/' on windows.\n    var file = path.resolve('/');\n\n    mkdirp(file, 0755, function (err) {\n        if (err) throw err\n        fs.stat(file, function (er, stat) {\n            if (er) throw er\n            t.ok(stat.isDirectory(), 'target is a directory');\n            t.end();\n        })\n    });\n});\n",
  "node_modules/mkdirp/test/sync.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\n\ntest('sync', function (t) {\n    t.plan(4);\n    var x = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n    var y = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n    var z = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n\n    var file = '/tmp/' + [x,y,z].join('/');\n\n    try {\n        mkdirp.sync(file, 0755);\n    } catch (err) {\n        t.fail(err);\n        return t.end();\n    }\n\n    exists(file, function (ex) {\n        t.ok(ex, 'file created');\n        fs.stat(file, function (err, stat) {\n            t.ifError(err);\n            t.equal(stat.mode & 0777, 0755);\n            t.ok(stat.isDirectory(), 'target not a directory');\n        });\n    });\n});\n",
