  "node_modules/isobject/node_modules/isarray/test.js": "var isArray = require('./');\nvar test = require('tape');\n\ntest('is array', function(t){\n  t.ok(isArray([]));\n  t.notOk(isArray({}));\n  t.notOk(isArray(null));\n  t.notOk(isArray(false));\n\n  var obj = {};\n  obj[0] = true;\n  t.notOk(isArray(obj));\n\n  var arr = [];\n  arr.foo = 'bar';\n  t.ok(isArray(arr));\n\n  t.end();\n});\n\n",
