  "node_modules/electron-window-state/node_modules/mkdirp/LICENSE": "Copyright 2010 James Halliday (mail@substack.net)\n\nThis project is free software released under the MIT/X11 license:\n\nPermission is hereby granted, free of charge, to any person obtaining a copy\nof this software and associated documentation files (the \"Software\"), to deal\nin the Software without restriction, including without limitation the rights\nto use, copy, modify, merge, publish, distribute, sublicense, and/or sell\ncopies of the Software, and to permit persons to whom the Software is\nfurnished to do so, subject to the following conditions:\n\nThe above copyright notice and this permission notice shall be included in\nall copies or substantial portions of the Software.\n\nTHE SOFTWARE IS PROVIDED \"AS IS\", WITHOUT WARRANTY OF ANY KIND, EXPRESS OR\nIMPLIED, INCLUDING BUT NOT LIMITED TO THE WARRANTIES OF MERCHANTABILITY,\nFITNESS FOR A PARTICULAR PURPOSE AND NONINFRINGEMENT. IN NO EVENT SHALL THE\nAUTHORS OR COPYRIGHT HOLDERS BE LIABLE FOR ANY CLAIM, DAMAGES OR OTHER\nLIABILITY, WHETHER IN AN ACTION OF CONTRACT, TORT OR OTHERWISE, ARISING FROM,\nOUT OF OR IN CONNECTION WITH THE SOFTWARE OR THE USE OR OTHER DEALINGS IN\nTHE SOFTWARE.\n",
  "node_modules/electron-window-state/node_modules/mkdirp/test/perm.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\nvar _0777 = parseInt('0777', 8);\nvar _0755 = parseInt('0755', 8);\n\ntest('async perm', function (t) {\n    t.plan(5);\n    var file = '/tmp/' + (Math.random() * (1<<30)).toString(16);\n    \n    mkdirp(file, _0755, function (err) {\n        t.ifError(err);\n        exists(file, function (ex) {\n            t.ok(ex, 'file created');\n            fs.stat(file, function (err, stat) {\n                t.ifError(err);\n                t.equal(stat.mode & _0777, _0755);\n                t.ok(stat.isDirectory(), 'target not a directory');\n            })\n        })\n    });\n});\n\ntest('async root perm', function (t) {\n    mkdirp('/tmp', _0755, function (err) {\n        if (err) t.fail(err);\n        t.end();\n    });\n    t.end();\n});\n",
  "node_modules/electron-window-state/node_modules/mkdirp/test/race.js": "var mkdirp = require('../').mkdirp;\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\nvar _0777 = parseInt('0777', 8);\nvar _0755 = parseInt('0755', 8);\n\ntest('race', function (t) {\n    t.plan(10);\n    var ps = [ '', 'tmp' ];\n    \n    for (var i = 0; i < 25; i++) {\n        var dir = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n        ps.push(dir);\n    }\n    var file = ps.join('/');\n    \n    var res = 2;\n    mk(file);\n    \n    mk(file);\n    \n    function mk (file, cb) {\n        mkdirp(file, _0755, function (err) {\n            t.ifError(err);\n            exists(file, function (ex) {\n                t.ok(ex, 'file created');\n                fs.stat(file, function (err, stat) {\n                    t.ifError(err);\n                    t.equal(stat.mode & _0777, _0755);\n                    t.ok(stat.isDirectory(), 'target not a directory');\n                });\n            })\n        });\n    }\n});\n",
  "node_modules/electron-window-state/node_modules/mkdirp/test/root.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar test = require('tap').test;\nvar _0755 = parseInt('0755', 8);\n\ntest('root', function (t) {\n    // '/' on unix, 'c:/' on windows.\n    var file = path.resolve('/');\n\n    mkdirp(file, _0755, function (err) {\n        if (err) throw err\n        fs.stat(file, function (er, stat) {\n            if (er) throw er\n            t.ok(stat.isDirectory(), 'target is a directory');\n            t.end();\n        })\n    });\n});\n",
  "node_modules/electron-window-state/node_modules/mkdirp/test/sync.js": "var mkdirp = require('../');\nvar path = require('path');\nvar fs = require('fs');\nvar exists = fs.exists || path.exists;\nvar test = require('tap').test;\nvar _0777 = parseInt('0777', 8);\nvar _0755 = parseInt('0755', 8);\n\ntest('sync', function (t) {\n    t.plan(4);\n    var x = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n    var y = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n    var z = Math.floor(Math.random() * Math.pow(16,4)).toString(16);\n\n    var file = '/tmp/' + [x,y,z].join('/');\n\n    try {\n        mkdirp.sync(file, _0755);\n    } catch (err) {\n        t.fail(err);\n        return t.end();\n    }\n\n    exists(file, function (ex) {\n        t.ok(ex, 'file created');\n        fs.stat(file, function (err, stat) {\n            t.ifError(err);\n            t.equal(stat.mode & _0777, _0755);\n            t.ok(stat.isDirectory(), 'target not a directory');\n        });\n    });\n});\n",
