  "node_modules/electron-window-state/node_modules/minimist/test/dash.js": "var parse = require('../');\nvar test = require('tape');\n\ntest('-', function (t) {\n    t.plan(5);\n    t.deepEqual(parse([ '-n', '-' ]), { n: '-', _: [] });\n    t.deepEqual(parse([ '-' ]), { _: [ '-' ] });\n    t.deepEqual(parse([ '-f-' ]), { f: '-', _: [] });\n    t.deepEqual(\n        parse([ '-b', '-' ], { boolean: 'b' }),\n        { b: true, _: [ '-' ] }\n    );\n    t.deepEqual(\n        parse([ '-s', '-' ], { string: 's' }),\n        { s: '-', _: [] }\n    );\n});\n\ntest('-a -- b', function (t) {\n    t.plan(3);\n    t.deepEqual(parse([ '-a', '--', 'b' ]), { a: true, _: [ 'b' ] });\n    t.deepEqual(parse([ '--a', '--', 'b' ]), { a: true, _: [ 'b' ] });\n    t.deepEqual(parse([ '--a', '--', 'b' ]), { a: true, _: [ 'b' ] });\n});\n",
  "node_modules/electron-window-state/node_modules/minimist/test/long.js": "var test = require('tape');\nvar parse = require('../');\n\ntest('long opts', function (t) {\n    t.deepEqual(\n        parse([ '--bool' ]),\n        { bool : true, _ : [] },\n        'long boolean'\n    );\n    t.deepEqual(\n        parse([ '--pow', 'xixxle' ]),\n        { pow : 'xixxle', _ : [] },\n        'long capture sp'\n    );\n    t.deepEqual(\n        parse([ '--pow=xixxle' ]),\n        { pow : 'xixxle', _ : [] },\n        'long capture eq'\n    );\n    t.deepEqual(\n        parse([ '--host', 'localhost', '--port', '555' ]),\n        { host : 'localhost', port : 555, _ : [] },\n        'long captures sp'\n    );\n    t.deepEqual(\n        parse([ '--host=localhost', '--port=555' ]),\n        { host : 'localhost', port : 555, _ : [] },\n        'long captures eq'\n    );\n    t.end();\n});\n",
