  "node_modules/argparse/lib/action/help.js": "/*:nodoc:*\n * class ActionHelp\n *\n * Support action for printing help\n * This class inherided from [[Action]]\n **/\n'use strict';\n\nvar util = require('util');\n\nvar Action = require('../action');\n\n// Constants\nvar c  = require('../const');\n\n/*:nodoc:*\n * new ActionHelp(options)\n * - options (object): options hash see [[Action.new]]\n *\n **/\nvar ActionHelp = module.exports = function ActionHelp(options) {\n  options = options || {};\n  if (options.defaultValue !== null) {\n    options.defaultValue = options.defaultValue;\n  } else {\n    options.defaultValue = c.SUPPRESS;\n  }\n  options.dest = (options.dest !== null ? options.dest : c.SUPPRESS);\n  options.nargs = 0;\n  Action.call(this, options);\n\n};\nutil.inherits(ActionHelp, Action);\n\n/*:nodoc:*\n * ActionHelp#call(parser, namespace, values, optionString)\n * - parser (ArgumentParser): current parser\n * - namespace (Namespace): namespace for output data\n * - values (Array): parsed values\n * - optionString (Array): input option string(not parsed)\n *\n * Print help and exit\n **/\nActionHelp.prototype.call = function (parser) {\n  parser.printHelp();\n  parser.exit();\n};\n",
  "node_modules/argparse/lib/action/store/true.js": "/*:nodoc:*\n * class ActionStoreTrue\n *\n * This action store the values True respectively.\n * This isspecial cases of 'storeConst'\n *\n * This class inherited from [[Action]]\n **/\n'use strict';\n\nvar util = require('util');\n\nvar ActionStoreConstant = require('./constant');\n\n/*:nodoc:*\n * new ActionStoreTrue(options)\n * - options (object): options hash see [[Action.new]]\n *\n **/\nvar ActionStoreTrue = module.exports = function ActionStoreTrue(options) {\n  options = options || {};\n  options.constant = true;\n  options.defaultValue = options.defaultValue !== null ? options.defaultValue : false;\n  ActionStoreConstant.call(this, options);\n};\nutil.inherits(ActionStoreTrue, ActionStoreConstant);\n",
